import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
import { Home } from "./pages/Home";
import { Navbar } from "./components/Navbar";
import { Footer } from "./components/Footer";

function App() {
  const router = createBrowserRouter([
    {
      path: "/",
      element:
        <div>
          <Navbar />
          <Home />
          <Footer />
        </div>,
    },
    {
      path: "/register",
      element: <Register />
    }
  ]);

  return (
    <RouterProvider router={router} />
  );
}

export default App;
